import React, { useState } from 'react';
import { createActivity } from '../Services/activityServices'; // Adjust the import path as needed

const CreateActivityForm = ({ onClose }) => {
    const [newActivity, setNewActivity] = useState({
        name: '',
        date: '',
        price: '',
        duration: '',
        category: '',
        ratings: '',
        specialDiscount: '',
        bookingOpen: false,
        tags: [{ name: '' }], // Initialize with one empty tag
        location: { lat: '', lng: '' },
    });

    const handleInputChange = (e) => {
        const { name, value } = e.target;
        setNewActivity((prev) => ({
            ...prev,
            [name]: value,
        }));
    };

    const handleTagChange = (index, value) => {
        const newTags = [...newActivity.tags];
        newTags[index].name = value;
        setNewActivity({ ...newActivity, tags: newTags });
    };

    const addTag = () => {
        setNewActivity({ ...newActivity, tags: [...newActivity.tags, { name: '' }] });
    };

    const handleSubmit = async (e) => {
        e.preventDefault();
        try {
            await createActivity(newActivity); // Call the createActivity function
            onClose(); // Close the form after successful creation
        } catch (error) {
            console.error('Failed to create activity:', error.message);
        }
    };

    return (
        <div className="activity-card">
            <form onSubmit={handleSubmit}>
                <h2>Create Activity</h2>
                <input
                    type="text"
                    name="name"
                    value={newActivity.name}
                    onChange={handleInputChange}
                    placeholder="Activity Name"
                    required
                />
                <input
                    type="date"
                    name="date"
                    value={newActivity.date}
                    onChange={handleInputChange}
                    required
                />
                <input
                    type="number"
                    name="price"
                    value={newActivity.price}
                    onChange={handleInputChange}
                    placeholder="Price"
                    required
                />
                <input
                    type="number"
                    name="duration"
                    value={newActivity.duration}
                    onChange={handleInputChange}
                    placeholder="Duration (minutes)"
                    required
                />
                <input
                    type="text"
                    name="category"
                    value={newActivity.category}
                    onChange={handleInputChange}
                    placeholder="Category"
                    required
                />
                <input
                    type="text"
                    name="ratings"
                    value={newActivity.ratings}
                    onChange={handleInputChange}
                    placeholder="Ratings"
                    required
                />
                <input
                    type="number"
                    name="specialDiscount"
                    value={newActivity.specialDiscount}
                    onChange={handleInputChange}
                    placeholder="Special Discount (%)"
                />

                <div className="activity-tags">
                    {newActivity.tags.map((tag, index) => (
                        <input
                            key={index}
                            type="text"
                            value={tag.name}
                            onChange={(e) => handleTagChange(index, e.target.value)}
                            placeholder={`Tag ${index + 1}`}
                        />
                    ))}
                    <button type="button" onClick={addTag}>
                        Add Tag
                    </button>
                </div>

                <input
                    type="text"
                    name="locationLat"
                    value={newActivity.location.lat}
                    onChange={(e) => setNewActivity({
                        ...newActivity,
                        location: { ...newActivity.location, lat: e.target.value },
                    })}
                    placeholder="Location Latitude"
                    required
                />
                <input
                    type="text"
                    name="locationLng"
                    value={newActivity.location.lng}
                    onChange={(e) => setNewActivity({
                        ...newActivity,
                        location: { ...newActivity.location, lng: e.target.value },
                    })}
                    placeholder="Location Longitude"
                    required
                />

                <label>
                    <input
                        type="checkbox"
                        name="bookingOpen"
                        checked={newActivity.bookingOpen}
                        onChange={() => setNewActivity({ ...newActivity, bookingOpen: !newActivity.bookingOpen })}
                    />
                    Booking Open
                </label>

                <button className="save-button" type="submit">Create Activity</button>
                <button className="cancel-button" type="button" onClick={onClose}>Cancel</button>
            </form>
        </div>
    );
};

export default CreateActivityForm;
